import { Row, Col, Card, CardTitle, CardText, Button } from 'reactstrap';

export default function Cuestionario(props) {

  for (let i = 0; i < props.listaPre; i++) {
    return (
      <Row>
        <Col>
          <Card body>
            <CardTitle tag="h5">
              Cuestionario addicción móvil
            </CardTitle>
            <CardText>

            </CardText>
            <Row sm={6}>
              <Button >
                Si
              </Button>
              <Button >
                No
              </Button>
            </Row>
          </Card>
        </Col>
      </Row>
    );
  }
}
